INSERT INTO `products` VALUES (4,'c7hyY2X24D','iwzC2RECkb','<div><b>Mac 2021 M1 24 inch là một thiết kế hoàn toàn mới với bảy màu sắc nổi bật tạo nên không gian làm việc năng động. Chip M1 nhỏ gọn nhưng hiệu năng mạnh mẽ đến khó tin.<br><br></b></div>','<div><b><i>Thiết kế siêu mỏng, cực kỳ bắt mắt<br><br>Apple đã tích hợp sức mạnh phần cứng và màn hình 4.5K vào một thiết bị duy nhất với độ mỏng chỉ 11,5mm. iMac 2021 M1 24 inch sở hữu ngôn ngữ thiết kế phẳng hiện đại khác hẳn thiết kế cong của thế hệ trước. Chiếc iMac này có trọng lượng 4.48kg và có chân đế dày 14.7mm. Cáp nguồn được chuyển sang dạn nam châm tương tự như MagSafe.<br><br></i></b></div>','imac24.webp',NULL,'2023-10-06 17:50:28.676000',_binary '',_binary '',123,1000,10,0.35,0.35,0.23,0.22,2,2,5,1),(8,'Macbook M1','Macbook-M1','<div>Laptop Apple MacBook Pro 16 inch M2 Pro 2023 12-core CPU/16GB/512GB/19-core GPU<br><br></div>','<div>Apple vừa giới thiệu đến người dùng chiếc MacBook Pro 16 inch M2 Pro 2023 có kiểu dáng mỏng nhẹ nhưng bên trong là một hiệu năng vô cùng mạnh mẽ đáp ứng được mọi tác vụ, hứa hẹn sẽ trở thành một người bạn đồng hành tuyệt vời trong công việc, học tập và giải trí<br></div>','imacbook.jpg',NULL,'2023-10-06 13:49:59.548000',_binary '',_binary '',300,1000,0,7,9,1,3,2,7,0,0),(12,'Laptop Acer Nitro 5 Gaming','Laptop-Acer-Nitro-5-Gaming','Đánh giá chi tiết Acer Nitro 5 Gaming AN515-57-53F9 i5 11400H/NH.QENSV.008','Acer Nitro 5 Gaming AN515-57-53F9 sẽ theo chân bạn trong mọi cuộc vui ở thế giới ảo. Chiếc laptop gaming có vẻ ngoài cool ngầu này trang bị hệ thống phần cứng mạnh mẽ hàng đầu từ Intel và NVIDIA, đồng thời tích hợp thêm nhiều cổng kết nối vô cùng tiện lợi cho các loại phụ kiện gắn ngoài mà bạn muốn s','Acer1.png',NULL,'2023-10-06 18:03:45.950000',_binary '',_binary '',100,200,3,7,9,2,2,1,6,0,0),(13,'vYgcIbEk47L','iphone-SE','<div>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim